import React, { useState } from "react";

const Categories = ({ categories }) => {
    return (
        <div className="btn-container">
            {categories.map((category, index) => (
                <button 
                  key={index} 
                  type="button" 
                  className="filter-btn"
                >
                    All
                </button>
            ))}
        </div>
    );
};

export default Categories;
